import React from 'react';
import { Counter } from './features/counter/Counter';
import NavBar from './features/NavBar/NavBar'
import './App.css';

function App() {
  return (
    <div className="App">
      <NavBar />
      <header className="App-header">
        <Counter />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
      </header>
    </div>
  );
}

export default App;
